import homeback from "./photo/home back.webp";
import Navbar from "./nav";
export default function Home(){
    return(
         <div className="home">
            <div className="navdiv">
            <Navbar />
            </div>
            <div className="container">
            <img className="homepic" src={homeback} alt="pic1"></img>
            <div class="text-block">
    <h4>Nature</h4>
    <p>What a beautiful sunrise</p>
    </div>
                {/* <div className="text1">BE FABULOUS. BE EMPOWERED. BE BLOWN AWAY!</div>
                <div className="text2">We're Committed to Service Excellence By EliteLove</div> */}
            </div>
         </div>
    );
}
